import OrderedItem from "./OrderedItem";
const PastOrders = (props) => {
  const ordersList = props.values.map((order) => (
    <OrderedItem
      key={order.id}
      id={order.id}
      name={order.name}
      image={order.image}
      price={order.price}
    />
  ));

  return (
    <li>
      <div>
        <h3>{props.id}</h3>

        <ul>{ordersList}</ul>
      </div>
    </li>
  );
};

export default PastOrders;
